import React from 'react';
import { Link } from 'react-router-dom';
import { CardView } from 'react-card-with-image';
import './Companies.css';
    const list = [
        {
            id: 'a',
            name: 'Robin',
        },
        {
            id: 'b',
            name: 'Dennis',
        },
    ];

    const Companies = () => {
        return (
            <ul>
                {list.map((item) => (
                    <li key={item.id}>{item.name}</li>
                ))}
            </ul>
        );
    };
export default Companies;
